import {
  SearchBar,
  SearchForm,
  SearchFormButton,
  SearchFormInput,
} from './styled';

import { GoSearch } from 'react-icons/go';

export const Searchbar = () => {
  return (
    <SearchBar>
      <SearchForm>
        <SearchFormButton type="submit">
          <GoSearch />
        </SearchFormButton>

        <SearchFormInput
          type="text"
          autocomplete="off"
          autofocus
          placeholder="Search images and photos"
        />
      </SearchForm>
    </SearchBar>
  );
};
